use 5.014;
use warnings;
use List::Util qw/ min reduce/;

#Code for minimum skew problem

#$_ = "GTCGA";
#$_ = "TAAAGACTGCCGAGAGGCCAACACGAGTGCTAGAACGAGGGGCGTAAACGCGGGTCCGAT";
$_ = "
";

my $g = 0;# total g count
my $c = 0;# total c count
my $i = 0;# initialize loop count variable

my @data = split "";#split string into individual array elements to be counted
my @skew; #to check correct skew values
push @skew,0;


my %counts; #initialize hash

while ($data[$i]){
	
	say "Iteration no: $i";
	
	if ($data[$i] eq "G"){
		say "G found";
		$g++;
	}elsif ($data[$i] eq "C"){
		say "C found";
		$c++;
	}
	my $gc_difference = $g - $c;
	push @skew, $gc_difference;
	$counts{$i+1} = $gc_difference;
	$i++
}

#say %counts;
#say "\n\n\n@skew\n";


my $foo = reduce { $a < $b ? $a : $b } @skew;#This is to determine least value # "min" doesn't work for NEGATIVE VALUES
say $foo;
open OUT1, ">All_skew_values_minimum_skew_problem.out" or die $!;
say OUT1 join ("\t",@skew);

# foreach (keys %counts){
	# say "Key = $_ \t Value = $counts{$_}";
# }

# my $min = min (0..$#skew);
# say "Minimum skew value is : $min";

open OUT2, ">Output_minimum_skew_problem.out" or die $!;

foreach (keys %counts){
	say "Key = $_ \t Value = $counts{$_}" if $counts{$_} == $foo;#Note: == is for comparing equality; = is for ASSIGNMENT
	print OUT2 $_, "\t", if $counts{$_} == $foo;
}



#Exit
exit;
